vec2 convert_position(vec2 p1, vec2 s1, vec2 s2, vec2 d2) {
    ivec2 p1i = ivec2(p1);
    ivec2 s1i = ivec2(s1);
    ivec2 s2i = ivec2(s2);
    ivec2 d2i = ivec2(d2);

    ivec2 index;
    ivec2 p2i;

    index *= 0;
    p2i *= 0;

    for (int j = 0; j < 2; j++) {
        index = mod(index, s2i); 
        index += p1i[j] * s1i[j]; 
        p2i += index / s2i; 
    }

    p2i = mod(p2i, d2i);
    return vec2(p2i) + 0.5;
}

