uniform vec4 d_Y;
uniform vec4 s_Y;

uniform vec2 d_x;
uniform vec2 s_x;
uniform vec4 d_X;
uniform vec4 s_X;

uniform int r;
uniform int C2;

void main() {
    vec4 p_Y = convert_position(gl_FragCoord.xy, s_y, s_Y, d_Y);    

    int n = int(p_Y.x);
    int h2 = int(p_Y.y);
    int w2 = int(p_Y.z);
    int c2 = int(p_Y.w);
    int h1 = h2 / r;
    int w1 = w2 / r;
    int c1 = c2 + (w2-w1*r)*C2 + (h2-h1*r)*C2*r;

    vec4 p_X = vec4(n, h1, w1, c1) + 0.5;
    vec2 p_x = convert_coord(p_X, s_X, s_x, d_x);

